int biao[2001];
int T;
long long n,m,k,p[100001];
int trans(char c){
	if(islower(c))return c-'a';
	if(isupper(c))return c-'A'+26;
}
long long check(long long x){
  for(int i=1;i<=m;i++){
    x-=x/p[i];
  }
  return x;
}
bool f[5000001];
long long getsum(long long x){
  long long now=biao[x/5000000],l=(x/5000000)*5000000+1,r=x;
  if(r-l+1>=2500000){
    std::swap(l,r);
    ++l;
    r+=4999999;
    now=biao[(x/5000000)+1];
    memset(f,0,sizeof f);
    for(long long j=100000;j;--j)
      for(long long k=std::max(j*j,((j+l-1)/j)*j);k<=r;k+=j)
        if(!f[k-l])f[k-l]=1,now-=j;
  }else{
    memset(f,0,sizeof f);
    for(long long j=100000;j;--j)
      for(long long k=std::max(j*j,((j+l-1)/j)*j);k<=r;k+=j)
        if(!f[k-l])f[k-l]=1,now+=j;
  }
  return now;
}
int32_t main(){
	for(int i=1,p=-1;i<=2000;i++){
		while(biao_s[++p]!=' '){
			biao[i]=biao[i]*52+trans(biao_s[p]);
		}
	}
  // cerr<<biao[1]<<endl;
  scanf("%lld",&T);
  for(int fd=1;fd<=T;fd++){
    scanf("%lld%lld%lld",&n,&m,&k);
    for(int i=1;i<=m;i++)scanf("%lld",p+i);
    long long l=1,r=n,mid,ans=-1;
    while(l<=r){
      mid=(l+r)>>1;
      if(check(mid)>=k)ans=mid,r=mid-1;
      else l=mid+1;
    }
    if(!~ans)puts("-1");
    else printf("%lld\n",getsum(ans));
  }
}